import React, { useEffect, useState } from 'react'
import {useParams} from 'react-router-dom'
import NavigationBar from './NavigationBar'
import axios from 'axios'
import { getAuth } from "firebase/auth"; 

function TaskAnalytics() {



    const {taskId} = useParams()
    const [taskElement, setTaskElement] = useState({})

    const user = getAuth().currentUser


    const fetchTask = async () =>{
        const res = await axios.get('http://localhost:4000/api/getTask', {
                    params: { userId: user.uid, taskId: taskId },
                    headers: {
                        Authorization: `Bearer ${user.accessToken}`,
                        'Content-Type': 'application/json',
                    },
                })

        setTaskElement(res.data)
    }

    useEffect(()=>{
        if(user){
            fetchTask()
        }
    })

    const shouldDisplayData = () =>{
        if(taskElement !== {}){
            return (
                <div></div>
            )
        }else{
            return null
        }
    }

    return (
        <>
          {shouldDisplayData()}
        </>
    )
}

export default TaskAnalytics
